import { HomePage } from './pages/HomePage/HomePage';
import { AdminPage } from './pages/AdminPage/AdminPage';
import { PostPage } from './pages/PostPage/PostPage';
import { Login } from './pages/Login/Login';

export const routes = [
  {
    path: '/',
    exact: true,
    component: PostPage 
  },
  {
    path: '/home',
    exact: true,
    component: PostPage
  },
  {
    path: '/admin',
    exact: true,
    component: AdminPage
  },
  {
    path: '/post',
    exact: true,
    component: PostPage
  },
  {
    path: '/post/:postId',
    exact: true,
    component: PostPage
  },
  {
    path: '/connexion',
    exact: true,
    component: Login
  },
];
